import { BrowserRouter, Route, Routes } from "react-router-dom";
// import { Provider } from 'react-redux';
// import store from './redux/store';

ReactDOM.render(

  // <Provider store={store}>
  <BrowserRouter>
    <Route path="/" element={<App />} />
  </BrowserRouter>,
  document.getElementById('root'));

// </Provider >
